import { 
    CAMBIAR_MENU
} from '../../types';

const fn1 = (state, action) => {
    switch(action.type) {
        case CAMBIAR_MENU:
            return {
                ...state,
                seleccion: action.payload
            }
        default:
            return state;
    }
}
export default fn1;
